import React from 'react';
import './HeaderNav.scss';


export default function SearchBar() {
  return (
    <form action="" class="search-box">
      <input type="search" name="search" pattern=".*\S.*" required />
      <button class="search-btn" type="submit">
        <span>Search</span>
      </button>
    </form>
  )
}
